import React from 'react'

export default function Tick() {
    const element = (
    <div>
        <h1>Hello, world!</h1>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
    </div>
    );
    return (
        <div>
            {element}
        </div>
    )
}

setInterval(Tick, 1000);
